  //{{{  netSlowEval
  
  cwtchStruct.prototype.netSlowEval = function () {
  
    const b  = this.board;
    const cx = colourMultiplier(this.turn)
  
    let h1 = Array(net_h1_size);
    for (let j=0; j < net_h1_size; j++) {
      h1[j] = net_h1_b[j];
    }
  
    for (let sq=0; sq<64; sq++) {
  
      const fr    = B88[sq];
      const frObj = b[fr];
  
      if (!frObj)
        continue;
  
      const index = inputIndex(frObj, fr);
  
      for (let i=0; i < net_h1_size; i++) {
        h1[i] += net_h1_w[index][i];
      }
    }
  
    let e = net_o_b;
  
    for (let i=0; i < net_h1_size; i++) {
      e += net_o_w[i] * relu(h1[i]);
    }
  
    return e * cx | 0;
  }
  
  //}}}
  //{{{  netFastEval
  
  cwtchStruct.prototype.netFastEval = function () {
  
    const cx = colourMultiplier(this.turn)
  
    let e = net_o_b;
  
    for (let i=0; i < net_h1_size; i+=NET_PAR) {
      e += net_o_w[i+0] * relu(this.net_h1_a[i+0]);
      e += net_o_w[i+1] * relu(this.net_h1_a[i+1]);
      e += net_o_w[i+2] * relu(this.net_h1_a[i+2]);
      e += net_o_w[i+3] * relu(this.net_h1_a[i+3]);
      e += net_o_w[i+4] * relu(this.net_h1_a[i+4]);
      e += net_o_w[i+5] * relu(this.net_h1_a[i+5]);
      e += net_o_w[i+6] * relu(this.net_h1_a[i+6]);
      e += net_o_w[i+7] * relu(this.net_h1_a[i+7]);
    }
  
    return e * cx | 0;
  }
  
