  //{{{  netReset
  
  cwtchStruct.prototype.netReset = function () {
  
    this.net_h1_a.set(net_h1_b);
  
  }
  
  //}}}
  //{{{  netAdd
  
  cwtchStruct.prototype.netAdd = function (obj, sq) {
  
    const i   = inputIndex(obj, sq);
    const h1i = net_h1_w[i];
  
    for (let h=0; h < net_h1_size; h+=NET_PAR) {
      this.net_h1_a[h+0] += h1i[h+0];
      this.net_h1_a[h+1] += h1i[h+1];
      this.net_h1_a[h+2] += h1i[h+2];
      this.net_h1_a[h+3] += h1i[h+3];
      this.net_h1_a[h+4] += h1i[h+4];
      this.net_h1_a[h+5] += h1i[h+5];
      this.net_h1_a[h+6] += h1i[h+6];
      this.net_h1_a[h+7] += h1i[h+7];
    }
  }
  
  //}}}
  //{{{  netDel
  
  cwtchStruct.prototype.netDel = function (obj, sq) {
  
    const i   = inputIndex(obj, sq);
    const h1i = net_h1_w[i];
  
    for (let h=0; h < net_h1_size; h+=NET_PAR) {
      this.net_h1_a[h+0] -= h1i[h+0];
      this.net_h1_a[h+1] -= h1i[h+1];
      this.net_h1_a[h+2] -= h1i[h+2];
      this.net_h1_a[h+3] -= h1i[h+3];
      this.net_h1_a[h+4] -= h1i[h+4];
      this.net_h1_a[h+5] -= h1i[h+5];
      this.net_h1_a[h+6] -= h1i[h+6];
      this.net_h1_a[h+7] -= h1i[h+7];
    }
  }
  
  //}}}
  //{{{  netMove
  
  cwtchStruct.prototype.netMove = function (frObj,fr,to) {
  
    const i1 = inputIndex(frObj, fr);
    const i2 = inputIndex(frObj, to);
  
    const h1 = net_h1_w[i1];
    const h2 = net_h1_w[i2];
  
    for (let h=0; h < net_h1_size; h+=NET_PAR) {
      this.net_h1_a[h+0] += h2[h+0] - h1[h+0];
      this.net_h1_a[h+1] += h2[h+1] - h1[h+1];
      this.net_h1_a[h+2] += h2[h+2] - h1[h+2];
      this.net_h1_a[h+3] += h2[h+3] - h1[h+3];
      this.net_h1_a[h+4] += h2[h+4] - h1[h+4];
      this.net_h1_a[h+5] += h2[h+5] - h1[h+5];
      this.net_h1_a[h+6] += h2[h+6] - h1[h+6];
      this.net_h1_a[h+7] += h2[h+7] - h1[h+7];
    }
  }
  
  //}}}
  //{{{  netCapture
  
  cwtchStruct.prototype.netCapture = function (frObj,fr,toObj,to) {
  
    const i1 = inputIndex(frObj, fr);
    const i2 = inputIndex(toObj, to);
    const i3 = inputIndex(frObj, to);
  
    const h1 = net_h1_w[i1];
    const h2 = net_h1_w[i2];
    const h3 = net_h1_w[i3];
  
    for (let h=0; h < net_h1_size; h+=NET_PAR) {
      this.net_h1_a[h+0] += h3[h+0] - h2[h+0] - h1[h+0];
      this.net_h1_a[h+1] += h3[h+1] - h2[h+1] - h1[h+1];
      this.net_h1_a[h+2] += h3[h+2] - h2[h+2] - h1[h+2];
      this.net_h1_a[h+3] += h3[h+3] - h2[h+3] - h1[h+3];
      this.net_h1_a[h+4] += h3[h+4] - h2[h+4] - h1[h+4];
      this.net_h1_a[h+5] += h3[h+5] - h2[h+5] - h1[h+5];
      this.net_h1_a[h+6] += h3[h+6] - h2[h+6] - h1[h+6];
      this.net_h1_a[h+7] += h3[h+7] - h2[h+7] - h1[h+7];
    }
  }
  
  //}}}
  //{{{  netPromote
  
  cwtchStruct.prototype.netPromote = function (pawnObj,promoteObj,sq) {
  
    const i1 = inputIndex(pawnObj,    sq);
    const i2 = inputIndex(promoteObj, sq);
  
    const h1 = net_h1_w[i1];
    const h2 = net_h1_w[i2];
  
    for (let h=0; h < net_h1_size; h+=NET_PAR) {
      this.net_h1_a[h+0] += h2[h+0] - h1[h+0];
      this.net_h1_a[h+1] += h2[h+1] - h1[h+1];
      this.net_h1_a[h+2] += h2[h+2] - h1[h+2];
      this.net_h1_a[h+3] += h2[h+3] - h1[h+3];
      this.net_h1_a[h+4] += h2[h+4] - h1[h+4];
      this.net_h1_a[h+5] += h2[h+5] - h1[h+5];
      this.net_h1_a[h+6] += h2[h+6] - h1[h+6];
      this.net_h1_a[h+7] += h2[h+7] - h1[h+7];
    }
  }
  
